// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./libraries/IERC20.sol";

contract MarginAccount {
    mapping(bytes32 => uint256) public balances;
    mapping(address => uint256) public lockedFunds;

    IERC20 public usdcToken;
    address public owner;

    address public positionManager;
    address public orderBook;

    uint256 insufficiantFundsPenalty;

    event Deposit(address indexed user, uint256 amount);
    event Withdraw(address indexed user, uint256 amount);

    modifier onlyOwner() {
        require(msg.sender == owner, "Only contract owner can call this function");
        _;
    }

    constructor(address _usdcToken) {
        usdcToken = IERC20(_usdcToken);
        owner = msg.sender;
    }

    function getPositionKey(address _user, address _token) internal pure returns (bytes32) {
        return keccak256(abi.encodePacked(_user, _token));
    }

    function deposit(uint256 _amount, address _indexToken) external {
        require(_amount > 0, "Amount must be greater than zero");
        require(
            usdcToken.transferFrom(msg.sender, address(this), _amount),
            "TransferFrom failed"
        );

        balances[getPositionKey(msg.sender, _indexToken)] += _amount;
        emit Deposit(msg.sender, _amount);
    }

    function withdraw(uint256 _amount, address _indexToken) external {
        require(_amount > 0, "Amount must be greater than zero");
        require(_amount <= balances[getPositionKey(msg.sender, _indexToken)], "Insufficient balance");

        balances[getPositionKey(msg.sender, _indexToken)] -= _amount;
        require(usdcToken.transfer(msg.sender, _amount), "Transfer failed");

        emit Withdraw(msg.sender, _amount);
    }

    function lockFunds(address _user, address _indexToken) external {
        require(msg.sender == orderBook);
        require(balances[getPositionKey(_user, _indexToken)] > insufficiantFundsPenalty);

        lockedFunds[_user] += insufficiantFundsPenalty;
        balances[getPositionKey(_user, _indexToken)] -= insufficiantFundsPenalty;
    }

    function unlockFunds(address _user, address _indexToken) external {
        require(msg.sender == orderBook);
        require(lockedFunds[_user] > insufficiantFundsPenalty);

        lockedFunds[_user] -= insufficiantFundsPenalty;
        balances[getPositionKey(_user, _indexToken)] += insufficiantFundsPenalty;
    }

    function updateFundingFee(address _user, address _indexToken, int256 _fundingFee) external returns (uint256) {
        require(msg.sender == positionManager);

        bytes32 _balanceKey = getPositionKey(_user, _indexToken);
        if (_fundingFee < 0) {
            balances[_balanceKey] += uint256(-_fundingFee);
        } else {
            // instead of this you need to liquidate user posisitons
            require(balances[_balanceKey] > uint256(_fundingFee));

            balances[_balanceKey] -= uint256(_fundingFee);
        }

        return balances[_balanceKey];
    }

    function changeOwner(address newOwner) external onlyOwner {
        require(newOwner != address(0), "Invalid owner address");
        owner = newOwner;
    }
}

